css:
.auto-cursor {
  cursor: default;
}
kite-hover {
  display: flex;
  flex-direction: column;
  background: #393d45;
  color: #d7dae0;
  border: 1px solid #54575f;
  padding: 2.5px 5px;
  border-radius: 3px;
  font-family: 'BlinkMacSystemFont', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  max-width: 600px;
  cursor: default;
}
kite-hover .debug {
  margin-top: 5px;
}
kite-hover .debug pre {
  cursor: text;
  -webkit-user-select: all;
  user-select: all;
  max-height: 300px;
  max-width: 500px;
  overflow: auto;
}
kite-hover .debug pre > * {
  pointer-events: none;
}
kite-hover .definition {
  display: flex;
  flex-direction: row;
  align-items: center;
  line-height: normal;
}
kite-hover .definition .type,
kite-hover .definition .signature,
kite-hover .definition a,
kite-hover .definition a:hover,
kite-hover .definition a:focus,
kite-hover .definition a:active {
  color: #9da5b4;
  pointer-events: none;
}
kite-hover .definition > * {
  flex: 1 1 0;
}
kite-hover .definition > *:empty {
  display: none;
}
kite-hover .definition > *:not(:first-child) {
  text-align: right;
  margin-left: 10px;
}
kite-hover kite-links {
  display: flex;
  align-items: center;
  align-content: center;
}
kite-hover kite-links .flex-separator {
  flex-grow: 1;
}
